const data=[{id:1,number:1,text:"Добрый день, это София из электро-лаборотории, подскажите, как можно связаться с ответственным по техническим вопросам ? * ответственным по хозяйственным вопросам, замом директора по АХЧ, главным инженером, энергетиком * \n - Или с кем я могу пообщаться по вопросу замеров сопротивления изоляции? \n * Если Вас не понимают * - С кем я могу пообщаться по вопросам электрики? \n - Если у вас нет ответственного, подскажите, к кому вы будете обращаться если возникнет какая-то серьёзная проблема или вопрос по электрике?",btn:[{nextId:13,text:"- Сейчас соединю!/ -Записывайте номер!"},{nextId:2,text:"По какому вопросу ?"}]},{id:2,number:2,text:"По поводу проведения плановых замеров сопротивления изоляции.",btn:[{nextId:3,text:"Его / её нет на месте! Перезвоните позже!"},{nextId:1,text:"Назад"}]},{id:3,number:3,text:"Подскажите, а как его / её зовут и по какому телефону с ним/ней можно связаться ? \n - в какое время удобно перезвонить ? * запиши и поставь задачу в какое время перезвонить ! *",btn:[{nextId:4,text:"У нас в организации нет такого человека!"},{nextId:2,text:"Назад"}]},{id:4,number:4,text:"Но ведь кто-то должен быть ответственный за электричество? К кому вы будете обращаться если возникнет какая-то серьёзная проблема или вопрос по электрике?",btn:[{nextId:5,text:"Вы хотите что-то предложить? / Продать ?"},{nextId:3,text:"Назад"}]},{id:5,number:5,text:"Нет, я хочу уточнить, когда в Вашем учереждении планируются работы по замерам сопротивления изоляции.",btn:[{nextId:6,text:"Что за замеры сопротивления изоляции? / Что это такое?"},{nextId:4,text:"Назад"}]},{id:6,number:6,text:"Замеры сопротивления изоляции - это обязательная проверка ваших розеток, щитовых и проводки. По итогу данных работ выдается технический отчет, это официальный документ, который требуется при проверках госорганов, например, - Ростехнадзор, Пожарный надзор. Подскажите, с кем можно поговорить по этому вопросу?",btn:[{nextId:7,text:"Я не знаю когда у нас проводились замеры сопротивления!"},{nextId:5,text:"Назад"}]},{id:7,number:7,text:"Тогда подскажите, пожалуйста, как мне связаться с ответственным по этому вопросу? * Электрик, инженер, энергетик, завхоз *",btn:[{nextId:8,text:"- Замеры у нас проводились '..называет время!'"},{nextId:22,text:"- Не знаю когда планируются замеры"},{nextId:6,text:"Назад"}]},{id:8,number:8,text:"Значит, я смогу с Вами поговорить по этому вопросу ? \n - Подскажите, как к Вам можнно обращаться * Необходимо уточнить и зафиксировать ФИО контакта в КОНТАКТАХ * ",btn:[{nextId:13,text:"Переходим к разговору с ЛПР"},{nextId:9,text:"Нас это не интересует!"},{nextId:28,text:"У нас есть своя компания!"},{nextId:29,text:"У нас все через торги (аукцион, конкурс, котировку, тендер)"},{nextId:30,text:"У нас внутренний тендер"},{nextId:32,text:"У нас внутренний тендер"},{nextId:33,text:"Нам нужна только 'бумажка' (сам отчет)"},{nextId:35,text:"Приезжайте и посчитайте нам стоимость!"},{nextId:36,text:"У нас нет денег!"},{nextId:37,text:"А у вас есть лицензия? / Есть допуски? (Свидетельство)"},{nextId:39,text:"Отправьте предложение по e-mail / общую информацию / прайс"},{nextId:40,text:"Планируем, но не сейчас! (В другом месяце, квартале)"},{nextId:41,text:"Мы уже выбрали компанию и она будет проводить работы!"},,{nextId:7,text:"Назад"}]},{id:9,number:9,text:"Это обязательные работы для всех организаций по приказу Минэнерго России от 12.08.2022 №811, мне нужно уточнить важную информацию по вашей организации по плановому периоду у ответственного по данному вопросу \n -Соединить, пожалуйста, с ответственным по данному вопросу",btn:[{nextId:99,text:"- Нам это категорически не интересно!"},{nextId:11,text:"- Отправьте предложение по e-mail / У нас все предложения через почту"},{nextId:8,text:"Назад"}]},{id:11,number:11,text:"Мне нечего отправлять по электронной почте, у меня нет предложений, мне необходимо уточнить плановый период проведения замеров сопротивления изоляции. С кем можно поговорить по этому вопросу?",btn:[{nextId:12,text:"У нас аренда"},{nextId:9,text:"Назад"}]},{id:12,number:12,text:"Понятно, но аренда не снимает с организации ответственность за проведение данных работ. Кто-то должен быть ответственный за электрику. С кем можно поговорить?",btn:[{nextId:13,text:"Перейти к разговору с ЛПР"},{nextId:11,text:"Назад"}]},{id:13,number:13,text:"<ИО клиента>, здравствуйте! Меня завут София, компания Энзибен, я звоню по вопросу замеров сопротивления изоляции! Подскажите, когда у вас планируются замеры сопротивления изоляции?",btn:[{nextId:14,text:"Да, мы планируем в ближайшее время "},{nextId:12,text:"Назад"}]},{id:14,number:14,text:"Отлично! Давайте я отправлю вам коммерческое предложение с нашей ценой! * Не ждать ответа и быстрее переходить к вопросу Нужно проскочить сомнения Контакта ! *",btn:[{nextId:15,text:"Нет, не нужно!"},{nextId:16,text:"Да, отправляйте!"},{nextId:13,text:"Назад"}]},{id:15,number:15,text:"< ИО клиента >, давайте я быстро направлю Вам Коммерческое предложение  с ценой. И после этого у Вас всегда под рукой будет цена и полный объем работ! \n Давайте я все-таки его Вам направклю?",btn:[{nextId:16,text:"Да, отправляйте!"},{nextId:99,text:"Нет, не нужно!"},{nextId:14,text:"Назад"}]},{id:16,number:16,text:"Подскажите количество автоматических выключателей у Вас на объекте!",btn:[{nextId:17,text:"Да, подскажу"},{nextId:18,text:"Нет, не знаю количество автоматов!"},{nextId:19,text:"Я не помню кол-во автоматов! / Где посмотреть?"},{nextId:20,text:"А какая цена?"},{nextId:15,text:"Назад"}]},{id:17,number:17,text:"Спасибо, сейчас я внесу их в сметный калькулятор и направлю Вам Коммерческое предложение! \n * 1) Заполняем кол-во измерений в Калькуляторе Замеров (по точкам) *  *2) Уточняем электронную почту и вбиваем ее в поле E-mail клиента в Калькуляторе Замеров * * 3) Жмем кнопку Создать Сделку * \n * 1 Автомат = 1 измерению сопротивления изоляции и = 1 измерению цепи <фаза-ноль> = 0,5 измерению цепи между заземлителями и заземленными элементами *",btn:[{nextId:98,text:"- назвали кол-во необходимых измерений"},{nextId:16,text:"Назад"}]},{id:18,number:18,text:"Подскажите тогда количество зданий и их примерную площадь! \n - Здания назодятся в разных районах Москвы или близко друг к другу ? \n * 1) В Калькулятор Замеров внести площадь, кол-во зданий, кол-во отдаленных объектов (по площади)* \n * 2) Уточняем электронную почту и вбиваем ее в поле E-mail клиента в Калькуляторе Замеров * \n * 3) Жмем кнопку Создать Сделку *",btn:[{nextId:97,text:"- Наша примерная площадь <> кв.метров; кол-во зданий <>, все в одном месте!"},,{nextId:16,text:"Назад"}]},{id:19,number:19,text:"Если этих данных нет под рукой, давайте определим стоимость по площади: \n - Подскажите тогда количество зданий и примерную площадь! \n - Здания находятся в разных районах Москвы или близко друг к другу? \n * 1) В Калькулятор Замеров внести площадь, кол-во зданий, кол-во отдаленных объектов (по площади) * * 2) Уточняем электронную почту и вбиваем ее в поле E-mail клиента в Калькуляторе Замеров * * 3) Жмем кнопку Создать Сделку *",btn:[{nextId:97,text:"- Наша примерная площадь <> кв.метров; кол-во зданий <>, все в одном месте!"},,{nextId:16,text:"Назад"}]},{id:20,number:20,text:"Сейчас я Вам посчитаю цену! Мне необходимо уточнить количество автоматических выключателей у Вас на объекте. Подскажите?",btn:[{nextId:21,text:"Позвоните позже! / - Не удобно сейчас говорить!"},{nextId:18,text:"Нет, не знаю количество автоматов!"},,{nextId:16,text:"Назад"}]},{id:21,number:21,text:"Подскажите, <ИО контакта>, вам перезвонить на этот номер? \n - В какое время Вам перезвонить ? \n *Зафиксировать время перезвона. В КОНТАКТЕ поставить ЗАДАЧУ на обозначенное время*",btn:[{nextId:99,text:"Ответ"},,{nextId:20,text:"Назад"}]},{id:22,number:22,text:"Подскажите, а Вы ответственный за данный вопрос?",btn:[{nextId:23,text:"- Да, я ответственный! / - Я его замещаю!"},{nextId:7,text:"Назад"}]},{id:23,number:23,text:"Данные испытания являются обязательными для всех организаций. Давайте я выставлю для Вас конкретное коммерческое предложение с ценой. В этом коммерческом предложении будет прописано, почему необходимо проводить данные замеры и чем это регламентируется. \n Отправить Вам коммерческое? ",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:24,text:"- Почему это обязательно? / - Это вы нас обязываете проводить?"},{nextId:25,text:"- А что это такое? / - Зачем это нам?"},{nextId:22,text:"Назад"}]},{id:24,number:24,text:"Замеры сопротивления изоляции - это обязательная проверка ваших розеток, щитовых и проводки, она регламентируется Приказом №811 Министерства энергетики Российской Федерации от 12 августа 2022 г. <Об утверждении Правил технической эксплуатации электроустановок потребителей> \n - Давайте я отправлю Вам коммерческое предложение с ценой, где будет описано для чего это необходимо?",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},,{nextId:23,text:"Назад"}]},{id:25,number:25,text:"Замеры сопротивления изоляции - это обязательная проверка ващих розеток, щитовых и проводки. По итогу данных работ вам выдается технический отчет, официальный документ, который должен быть у каждой организации. \n Если что то случается с электрикой на объекте, то Ростехнадзор или Пожарный надзор первым делом требуют Технический отчет по замерам сопротивления изоляции. \n Давайте я составлю для Вас коммерческое предложение с ценой, где так же подробно будет описано для чего это необходимо?",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:26,text:"Как будут проходить работы? / - Что именно вы делаете?"},{nextId:23,text:"Назад"}]},{id:26,number:26,text:"- В Вашу организацию приезжает наш инженер, с допуском к электриспытаниями и проверенными приборами. Не отвлекая Вас от работы, он проводит замеры сопротивления изоляции *проводки*, петли <Фаза-ноль> *розеток* , металлосвязи *щитовых и оборудования*. После этого инженер направляется обратно в офис формировать технический отчет с актом дефектной ведомости. \n Технический отчет является обязательным официальным документом для вашей организации и для проверяющих органов (Ростехнадзор, Пожарный надзор). А так же это гарантия безопасности Вашего электрохозяйства. \n Давайте я составлю для Вас коммерческое предложение с ценой, где так же будет подробно описано какие работы входят в эту стоимость?",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:27,text:"- Как долго проводятся эти работы?"},{nextId:25,text:"Назад"}]},{id:27,number:27,text:"Время проведения работ зависит от объема и Вашей срочности. К примеру, если у Вас одно здание, среднего размера, у нас уйдет один день на замеры и один день на составление технического отчета в офисе: итого 2 дня. \n В среднем работы занимают от 1-2 дня, а если объект крупный, то до 1 недели. \n Давайте я соствалю для Вас коммерческое предложение с ценой, это позволит Вам сэкономить время!?",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:26,text:"Назад"}]},{id:28,number:28,text:"<ИО клиента>, почему вы остановились на этой компании? Давайте мы сделаем вам более выгодное предложение по цене? Если вы сориентируете меня по стоимости вашего предложения, я постараюсь предложить вам наиболее выгодную цену! \n - У нас большой штат инженеров, мы можем выполнять большой объем работ в короткий срок. \n - Работаем на рынке 7 лет, сотрудничаем с более чем 2000 клиентов, например <Тип компании> * Называем в тип компании в которую звоним - Банк, Школа и т.п. * \n - Выполняем работы 24 часа в сутки 7 дней в неделю \n - Наш инженер может приехать и сделать отчет проверяющим органам, когда это потребуется \n - Давайте, я отправлю наше коммерческое предложение для сравнения? Вы сможете сравнить стоимость услуг, а потом сделать свой взвешенный выбор.",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:8,text:"Назад"}]},{id:29,number:29,text:"Хорошо! Но давайте мы предложим для Вас цену до 100 тысяч рублей (образование, культура - до 400 000 р.), возможно ли в таком случае заключить прямой договор? * Это значит без торгов с конкурентами * Давайте я подготовлю Вам коммерческое предложение с нашей ценой! * Это только для государственных и бюджетных учереждений * \n * - На данный момент, наша компания не принимает участи в гос. закупках, аукционах, т.к. падение по замерам сопротивления изоляции составляет более 90% и невозможно провести качественные работы за такие суммы. *",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:8,text:"Назад"}]},{id:30,number:30,text:"Хорошо, мы с удовольствием примем в нем участие, давайте я отправлю коммерческое предложение, а также все дополнительные документы, которые потребуются для участия в тендере. Подскажите, по каким критериям будет выбираться победитель? \n У вас уже есть коммерческое предложение от других организаций? \n - Если вы сориентируете меня по стоимости этих предложений, я постараюсь предложить вам наиболее выгодную? \n - Давайте, мы предложим для Вас хорошую стоимость и подготовим коммерческое предложение от сторонних организаций, это поможет сэкономить ваше время.",btn:[{nextId:31,text:"- Нам это не интересно"},,{nextId:8,text:"Назад"}]},{id:31,number:31,text:"<ИО клиента>, это обязательные работы, давайте я отправлю Вам наше коммерческое предложение с ценой, возможно когда-то вам понадобится, и Вы сможите найти его на Ващей почте? \n * - Далее действовать в зависимости от ответа клиента - Записывать причину отказа в AMO CRM*",btn:[{nextId:99,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:30,text:"Назад"}]},{id:32,number:32,text:"Компания Энзибен. Мы работаем более шести лет и имеем более 2000 контрактов по данной тематике. Мы находимся в Бизнес Центре 'Омега Плаза' ",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:8,text:"Назад"}]},{id:33,number:33,text:"В независимости от того, что Вам нужен только документ, мы не сможем сформировать его без выезда! Самый быстрый и дешевый способ - мы направим Вам нашего инженера, он быстро все пройдет, проверит и выдаст Вам настоящий документ. Вас отвлекать он не будет и вы будете точно уверены, что у вас на руках настоящий полноценный качественный технический отчет для прохождения проверок. \n Давайте убедимся, что это не дорого, я отправлю коммерческое предложение с ценой для Вас!",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:8,text:"Назад"}]},{id:34,number:34,text:"Исходя из нашего опыта, штрафы обходятся дороже чем сами замеры! И в любом случае, замеры после штрафа нужно будет делать. Например, штрафы Пожарного надзора - 200 000 рублей, и штраф Ростехнадзора - 40 000 рублей. \n - Давайте я отправлю Вам коммерческое предложение с ценой и Вы убедитесь, что Замеры сопротивления изоляции стоят не так дорого?",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:42,text:"Назад"}]},{id:35,number:35,text:"Да, скажите, когда Вам будет удобно, наш инженер подъедет и сам посчитает объем работ. А после этого я сформирую Вам стоимость и отправлю Коммерческое предложение. Подскажите, точный адрес нахождения Вашего объекта. * - Сообщите дату и адрес встречи ответственному по встречам (поставить задачу в CRM)*",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:8,text:"Назад"}]},{id:36,number:36,text:"Подскажите, известно когда ситуация прояснится? Когда Вам перезвонить? *Записать время перезвона, поставить себе ЗАДАЧУ перезвонить в Сделке!*",btn:[{nextId:99,text:"- Ответ"},{nextId:8,text:"Назад"}]},{id:37,number:37,text:"Да, конечно, все лицензии у нас есть! Они прикладываются к финальному отчету. Так же лицензии прикрепляются к Коммерческому предложению, давайте я Вам его отправлю?",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:8,text:"Назад"}]},{id:38,number:38,text:"Подскажите, а когда Вы проводили замеры? В каком месяце? \n - Давайте я отправлю Вам наше Коммерческое предложение с ценой, Вы сможите сравнить его с Вашей стоимостью, а когда подойдет плановый период - я Вам перезвоню! *Записать время перезвона, поставив ЗАДАЧУ в Сделке!*",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:0,text:"Назад"}]},{id:39,number:39,text:"<ИО клиента>, мы обязательно отправим Вам наше предложение по электронной почте. Подскажите, Вашу площадь или количестов автоматических выключателей, чтобы я отправила вам предложение с ценой \n После этого у Вас на почте останется вся подробная инофрмация и цена! \n *(У нас нет единого прайса за точку измерения. Цена формируется в сметном калькуляторе в зависимости от объемов и типа организаций)*",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:42,text:"Как это вы считаете Замеры по площади?!"},{nextId:8,text:"Назад"}]},{id:40,number:40,text:"<ИО клиента>, давайте я Вам отправлю Коммерческое предложение, чтобы оно было всегда под рукой, Вам будет проще сориентироваться в цене и принять решение в будущем ? \n *(Нужно сразу же отправить ему КП. Если совсем не интересно - уточнить, когда планируют и поставить ЗАДАЧУ перезвонить в СДЕЛКЕ)*",btn:[{nextId:15,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:8,text:"Назад"}]},{id:41,number:41,text:"<ИО клиента>, почему вы остановились на этой компании? Давайте мы сделаем вам более выгодное предложение по цене! \n - Давайте, я отправлю наше коммерческое предложение для сравнения ? \n *Ждем ответ. Если точно нет. предлагаем КП на следующий плановый период* \n <ИО клиента>, тогда давайте, я отправлю наше коммерческое предложение на будущий плановый период. Давайте направлю?",btn:[{nextId:99,text:"- Нет, не нужно!"},{nextId:16,text:"- Да, давайте!"},{nextId:8,text:"Назад"}]},{id:42,number:42,text:"Мы работаем более шести лет и имеем более 2000 контрактов по данной тематике. Все здания и организации типовые, поэтому мы создали сметный калькулятор, который считает цену исходя из площади. Калькулятор учитывает какое кол-во автоматических выключателей в среднем бывает на заданной площади в заданном типе организации. \n - Давайте я отправлю Вам коммерческое предложение с ценой ? \n *(Данный ответ подходит всем кроме тех, у кого на большой площали маленькое кол-во электроустановок изначально, это только - ТСЖ, УК, парковки, склады, гаражи. Для таких Ответ №34 (Наш инженер приедет и сам посчитает объем))*",btn:[{nextId:99,text:"- Нет, не нужно!"},{nextId:18,text:"- Да, давайте!"},{nextId:34,text:"- (№34) Да, давайте!"},{nextId:39,text:"Назад"}]},{id:97,number:97,text:"Спасибо большое <ИО клиента>, Коммерческое предложение с ценой уже отправлено Вам на почту! \n Удобно если я завтра Вам перезвоню уточнить о решении ? \n Если не удобно в это время, уточните, когда удобно перезвонить *изменить время перезвона в ЗАДАЧЕ в СДЕЛКЕ!* \n - Спасибо, до свидания!",btn:[{nextId:1,text:"В начало"},{nextId:18,text:"Назад"}]},{id:98,number:98,text:"Спасибо большое <ИО клиента>, Коммерческое предложение с ценой уже отправлено Вам на почту! \n - Спасибо, до свидания!",btn:[{nextId:1,text:"В начало"},{nextId:17,text:"Назад"}]},{id:99,number:99,text:"Спасибо, что уделили время, до свидания!",btn:[{nextId:1,text:"В начало"}]}];